import React from 'react'
import './Posts.css'
import { PostData} from '../../Data/PostData'

const Posts = () => {
  return (
    <div className='Post'>
        {PostData.ap((post, id) => {
            return <Post/>
        })}
    </div>
  )
}

export default Post
